import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Upload from './pages/Upload';
import Dashboard from './pages/Dashboard';
import History from './pages/History';
import Visualizations from './pages/Visualizations';
import axios from 'axios';
import './App.css';  // Adjust if your CSS file is named differently

function App() {
  const [authSet, setAuthSet] = useState(false);
  const [error, setError] = useState('');

  useEffect(() => {
    const username = localStorage.getItem('username');
    const password = localStorage.getItem('password');
    if (!username || !password) {
      const user = prompt('Enter username:');
      const pass = prompt('Enter password:');
      if (user && pass) {
        localStorage.setItem('username', user);
        localStorage.setItem('password', pass);
        const token = btoa(`${user}:${pass}`);
        axios.defaults.headers.common['Authorization'] = `Basic ${token}`;
        setAuthSet(true);
      } else {
        setError('Authentication required. App cannot proceed.');
        return;
      }
    } else {
      const token = btoa(`${username}:${password}`);
      axios.defaults.headers.common['Authorization'] = `Basic ${token}`;
      setAuthSet(true);
    }
  }, []);

  if (error) return <div style={{ color: 'red', padding: '20px' }}>{error}</div>;
  if (!authSet) return <div style={{ padding: '20px' }}>Setting up authentication...</div>;

  return (
    <Router>
      <div className="app">
        <nav>
          <ul className="tabs">
            <li><Link to="/upload">Upload</Link></li>
            <li><Link to="/dashboard">Dashboard (Summary)</Link></li>
            <li><Link to="/history">History</Link></li>
            <li><Link to="/visualizations">Visualizations</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/upload" element={<Upload />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/history" element={<History />} />
          <Route path="/visualizations" element={<Visualizations />} />
          <Route path="/" element={<Dashboard />} />  // Default route
        </Routes>
      </div>
    </Router>
  );
}

export default App;



